import React from "react";
import styled from "styled-components";
const Menu = () => {
  const Background = styled.div`
    position: absolute;
    background-color: rgba(0, 0, 0, 0.704);
    width: 100%;
    height: 100rem;
  `;
  const Container = styled.div`
    background-color: white;
    width: 50%;
    height: 100%;
  `;
  return (
    <>
      <Background></Background>
    </>
  );
};

export default Menu;
